import React from "react";
import Header from "../parts/Header";
import FreshStories from "../parts/FreshStories";
import Footer from "../parts/Footer";
import Navbar from "../parts/Navbar";
import Submit from "../parts/Submit";

const Add = () => {
  return (
    <>
      <Navbar />
      <Header />
      < Submit />
      <Footer />
    </>
  );
};

export default Add;
